import React from 'react';
import './List.css';
import {Link} from 'react-router-dom';

function List({userImage, name, message, url, type}) : any {
  return (
    <Link to={url}>
        <li>
                <img className={type+'_image'} src={userImage}/>
                <span className='_name'>{name}</span>
                <span className='_message'>{message}</span>
        </li>
    </Link>
  );
}

export default List;
